import React from 'react';
import { NavLink } from 'react-router-dom';

// function Abtpress(){
//     // document.getElementById("foot").style.marginTop="190px"
//     // let footer=document.getElementById("foot").style.paddingTop=
//     // let footer=document.getElementById("foot").style.marginTop="190px"
//     // footer.style.marginTop="50px"
//     // about.style.color="yellow"
//     console.log("helo")
// }
// function Abtpress2(){
//     document.getElementById("foot").style.marginTop="190px"
//     console.log("hi")
// // }
// let btn=document.getElementById("homes")
// btn.addEventListener("click",(e)
//     document.getElementById("foot")

function Navbar() {
    return (
        <>
            <nav className="navbar navbar-expand-lg">
                <div className="container col-md-10">
                    {/* <a id="title" className="navbar-brand" href="#">Harris's Portfolio</a> */}
                    <NavLink
                                    id='title'
                                    activeclassName="active"
                                    className="nav-link"
                                    aria-current="page"
                                    to="/Home"
                                >
                                    Harris's Portfolio
                                </NavLink>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav ms-auto">
                            <li className="nav-item">
                                <NavLink
                                    id='home'
                                    activeclassName="active"
                                    className="nav-link"
                                    aria-current="page"
                                    to="/Home"
                                >
                                    Home
                                </NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink
                                    id='home'
                                    activeclassName="active"
                                    className="nav-link"
                                    aria-current="page"
                                    to="/About"
                                   
                                >
                                    About
                                </NavLink>
                            </li>
                            <li className="nav-item" >
                                <NavLink
                                    id='homes'
                                    activeclassName="active"
                                    className="nav-link"
                                    aria-current="page"
                                    to="/Projects"
                                    // onClick={Abtpress2()}
                                >
                                    Projects
                                </NavLink>
                            </li>
                            <li className="nav-items">
                                <NavLink
                                    id='home'
                                    activeclassName="active"
                                    className="nav-link"
                                    aria-current="page"
                                    to="/contact"
                                >
                                    Contact
                                </NavLink>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
            <script src="./Portfolio."></script>
        </>
    )
}

export default Navbar
